public class _002StringAmazingSubString {
    public int solve1(String A) {
        char[] charr = A.toCharArray();
        for(int i=0;i<charr.length;i++){
            for(int j=i;j<charr.length;j++){
                for(int k=i;k<=j;k++){
                    System.out.print(charr[k]+" ");
                }
                System.out.println();
            }
        }
        return 0;
    }
    public int solve(String A) {
        int answer = 0;
        char[] charr = A.toCharArray();
        for(int i=0;i<charr.length;i++){
            if(charr[i]=='a' || charr[i]=='A' || charr[i]=='e' || charr[i]=='E' || charr[i]=='i' || charr[i]=='I' 
            ||charr[i]=='o' || charr[i]=='O' || charr[i]=='u' || charr[i]=='U'){
                answer+=(A.length()-i);
            }
        }
        return answer%10003;
    }
    public static void main(String[] args) {
        _002StringAmazingSubString obj = new _002StringAmazingSubString();
        obj.solve1("ABEC");
        System.out.println(obj.solve("ABEC"));
        System.out.println(obj.solve(""));
    }
}
